Border Wars Season 2

Technology Documentary hosted by Rodd Housten, published by National Geographic in 2010 - English narration


Information
------------------------------

Border Wars Season 2
The officers and agents of the U.S. Customs and Border Protection (CBP) scour the inhospitable landscape at one of the busiest border crossings in the country, seeking to intercept illegal entrants from the air, on the ground, and at the port of entry. Every day thousands of men, women and children attempt to enter the United States illegally -- some looking for work, some seeking a new life and others trying to smuggle drugs or other contraband. Many will do whatever it takes, often risking their lives by crossing Arizona's treacherous Sonoran Desert. Now, follow the officers and agents who struggle every day to defend this border.



3)  Contraband Highway 
At the border checkpoint in Hidalgo, Texas, a seemingly ordinary car is found to have firearms and ammunition hidden in its console and under its bumpers. Members of BORTAC, the tactical unit that identifies smuggling routes, discover what could be a remote transfer point for illicit goods. Further surveillance supports their theory, and the team hopes to close in on an active operation - if they can avoid detection by cartel scouts.


